import React from 'react';
import logo from '../dog.svg'

function Navbar () {
  return (
    <nav>
      <img src={logo} alt="logo"/>
      <a href="#">About</a>
      <a href="#">Services</a>
      <a href="#">Clients</a>
      <a href="#">Contact</a>
    </nav>
  );
}

export default Navbar;
